    getScaledPoints: function(points, field, maxWidth){
        console.log('getScaledPoints: points, field = ', points, field);
        if (field == undefined){
            return points;
        }
        if (maxWidth == undefined){
            maxWidth = 720;
        }
        var maxHeight = 1.0 * maxWidth * field.width / field.height;
        var kx = 1.0 * maxWidth / field.width;
        var ky = 1.0 * maxHeight / field.height;
        for (var i in points){
            points[i].x = points[i].x * kx;
            points[i].y = points[i].y * ky;
        }

        return points;
    },

